import "./App.css";

function Footer() {
  return (
    <>
      <footer class="py-4 border-top footer-color">
        <div class="container-md d-flex flex-wrap justify-content-between align-items-center">
          <div class="col-md-4 d-flex align-items-center">
            <span class="mb-3 mb-md-0 ">2023 Movie Rater</span>
          </div>
          <ul class="nav col-md-4 justify-content-end list-unstyled d-flex">
            <li class="ms-3 text-muted">use the tmdb</li>
          </ul>
        </div>
      </footer>
    </>
  );
}

export default Footer;
